import React from 'react';
import { useFonts } from 'expo-font';
import { StatusBar } from 'expo-status-bar';
import { View } from 'react-native';
import { Container, Content, HomeContainer, HomeContent } from "./styles/StylePrice";
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome'
import { faRightFromBracket } from "@fortawesome/free-solid-svg-icons";


function Price({ navigation }) {
    return (
        <Container>
            <Content>

            </Content>
          <HomeContainer>
            <HomeContent onPress={() => navigation.navigate('Login')}>             
            <FontAwesomeIcon icon={faRightFromBracket} size={ 52 } color={ '#677689' }/>
            </HomeContent>
            <HomeContent onPress={() => navigation.navigate('Login')}>             
            <FontAwesomeIcon icon={faRightFromBracket} size={ 52 } color={ '#677689' }/>
            </HomeContent>
          </HomeContainer>

        </Container>
    );
  };

  export default Price;
